import React, { Button } from "./Button";

export const Box = () => {
  return (
    <div className="w-[606px] h-[440px]">
      <div className="fixed w-[606px] h-[440px] top-0 left-0 rounded-[5px] overflow-hidden border border-dashed border-[#9747ff]">
        <div className="relative w-[245px] h-16 rounded-[118px]">
          <Button className="!absolute !left-0 !top-0" state="normal" type="primary" />
          <Button className="!absolute !left-0 !top-0" state="normal" type="secondary" />
          <Button className="!absolute !left-0 !top-0" state="hover" type="secondary" />
          <Button className="!absolute !left-0 !top-0" state="normal" type="border" />
          <Button className="!absolute !left-0 !top-0" state="normal" type="small" />
          <Button className="!absolute !left-0 !top-0" state="hover" type="small" />
          <Button className="!absolute !left-0 !top-0" state="normal" type="link" />
          <Button className="!absolute !left-0 !top-0" state="hover" type="link" />
          <Button className="!absolute !left-0 !top-0" state="hover" type="border" />
          <Button className="!absolute !left-0 !top-0" state="hover" type="primary" />
        </div>
      </div>
    </div>
  );
};
